package com.kashish.tutorial.java.practise;

public class SumOfElementsOfArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int[] arr= {3,5,9};
     int sum=0;
     
     for(int i=0; i<arr.length; i++) {
    	 sum=sum+arr[i];
  
     }
  	 System.out.print(sum);
	}

}
